function createKeywordsIdeaFromJson(json) {
    // console.log('createKeywordsIdeaFromJson ' + JSON.stringify(json));
    ideasList = JSON.parse(json["data"]);
    if (!ideasList) {
        ideasList = [];
        console.log('hiding ideas tab')
        $('#ideas-tab').hide();
    }
    console.log('createKeywordsIdeaFromJson ' + ideasList.length)
    var keywordIdeasTable = $('#keywordIdeasTable').DataTable({
        "datatype": "json",
        "data": ideasList,
        // rowId: 'keyword',
        "columns": [
            {
                "data": "keyword",
                "name": "keyword",
                "title": "Keyword",
                "defaultContent": "",
                render: function (data, type, row, meta) {
                    return payingUser ? data : 'Upgrade to see';
                },
            },
            {
                "data": "search_volume",
                "name": "search_volume",
                "title": "Search Volume",
                "defaultContent": "",
                render: function (data, type, row) {
                    return formatNumber(data);
                }
            },
            {
                "data": "competition_index",
                "name": "competition_index",
                "title": "Competition",
                "defaultContent": "",
                render: function (data, type, row) {
                    if (!data) {
                        data = 10;
                    }
                    let cls = 'bg-danger';
                    if (data < 25) {
                        cls = 'bg-success';
                    } else if (data < 50) {
                        cls = ''
                    } else if (data < 75) {
                        cls = 'bg-warning';
                    }
                    let html = '<div class="progress">\n' +
                        '  <div class="progress-bar ' + cls + '" role="progressbar" style="width:' + data + '%" aria-valuenow="' + data + '" aria-valuemin="0" aria-valuemax="100">' + data + '%</div>\n' +
                        '</div>';
                    return html;
                }
            },
        ],
        destroy: true,
        buttons: ['copy', 'excel', 'print', {
            extend: 'pdfHtml5', orientation: 'landscape', pageSize: 'LEGAL'
        }],
        "dom": '<"dt-buttons"Bf><"clear">firtlp',
        info: false,
        fixedHeader: true,
        deferRender: true,
        paging: false,
        "bFilter": true,
        "columnDefs": [{
            "targets": 'no-sort',
            "orderable": false,
        }],
        "initComplete": function (settings, json) {
            // $('#keywordIdeasTable').show();
        },
    });
}

function loadKeywordResearchList() {
    console.log('start loadKeywordResearchList');
    if (isDev() || !payingUser) {
        // $('#ideasListUpgrade').show();
        createKeywordsIdeaFromJson(JSON.parse(keywordIdeas));
        if (!payingUser) {
            $('table#keywordIdeasTable tbody tr').css('opacity', 0.3);
            $('.upgradeBlock').show();
        }
    } else {
        $.getJSON(getApiUrl('getMyJsonIdeasKeyword'), function (json) {
            if (json) {
                createKeywordsIdeaFromJson(json);
            }
        });
    }
}